// src/pages/Dashboard.jsx
import React from "react";
import SummaryCard from "../components/SummaryCard";
import ProjectCard from "../components/ProjectCard";

const Dashboard = () => {
  // Mock data
  const projects = [
    { id: 1, name: "Website Design", description: "Design landing page", hourlyRate: 20 },
    { id: 2, name: "React App", description: "Build frontend app", hourlyRate: 25 },
  ];

  return (
    <div className="dashboard-page">
      <h1>Dashboard</h1>
      <div className="summary-cards">
        <SummaryCard title="Total Hours" value="35" />
        <SummaryCard title="Total Earnings" value="$750" />
        <SummaryCard title="Active Projects" value="2" />
      </div>
      <h2>Recent Projects</h2>
      <div className="projects-list">
        {projects.map((project) => (
          <ProjectCard key={project.id} project={project} onStart={() => alert("Start work")} />
        ))}
      </div>
    </div>
  );
};

export default Dashboard;
